  [],\n\t\"revision_timestamp\": \"2016-10-21T17:48:05.604121\",\n\t\"name\": \"malheur-national-wildlife-refuge-narrative-report-1990-calendar-year\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"This Annual Narrative Report for Malheur
  National Wildlife Refuge summarizes refuge activities during 1990.  The report begins
  with information about the yearu2019s highlights and climatic conditions.   Land
  acquisition- including fee title, easements, other acquisitions, and Farmers Home
  Administration Conservation Easements- is also covered.  The report includes a planning
  section which discusses the master plan, the management plan, public participation,
  compliance with Environmental Resource Mandates, and research/investigations.  Refuge
  administration is outlined; lists of personnel, youth programs, and volunteer programs
  are given.  Habitat management is also covered.  Subjects include wetlands, croplands,
  grasslands, grazing, haying, fire management, pest control, water rights, and special
  wilderness areas.  The wildlife section of the report discusses wildlife diversity,
  endangered/threatened species, waterfowl, marsh/water birds, shorebirds, raptors,
  game animals, animal control, banding, and disease prevention.  The public uses
  of the refuge described in this report include general use, outdoor classrooms,
  interpretive foot trails, tours, hunting, fishing, trapping, and wildlife observation.
  \ The equipment and facilities section of the report provides information about
  new construction, rehabilitation, major maintenance, equipment replacement, communication
  systems, and energy conservation.\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\":
